import React, { useEffect, useMemo, useState } from "react";
import { useNavigate } from "react-router-dom";
import supabase from "../supabaseClient";
import "./Inbox.css";

const TABS = [
    { key: "incoming", label: "Gelen (Atanmamış)" },
    { key: "assigned", label: "Bana Atananlar" },
    { key: "approvals", label: "Onayımda" },
    { key: "sla", label: "SLA Riski (<24s)" },
];

export default function Inbox() {
    const navigate = useNavigate();

    // Profil bilgisini al
    const me = useMemo(() => {
        try { return JSON.parse(localStorage.getItem("user_profile") || "{}"); }
        catch { return {}; }
    }, []);
    const myEmail = me?.email;

    const [tab, setTab] = useState("incoming");
    const [loading, setLoading] = useState(false);
    const [rows, setRows] = useState([]);
    const [err, setErr] = useState("");

    // --- AUTH GUARD: token yoksa login'e at ---
    useEffect(() => {
        const token = localStorage.getItem("auth_token");
        if (!token) {
            navigate("/login", { replace: true });
        }
    }, [navigate]);

    useEffect(() => { fetchData(); /* eslint-disable-next-line */ }, [tab]);

    async function fetchData() {
        if (!myEmail) return;
        setErr(""); setLoading(true);

        try {
            const now = new Date();
            let q = supabase.from("requests").select(`
        id, title, status, priority, requester_email, assignee_email,
        updated_at, due_at, sla_deadline_at
      `).order("updated_at", { ascending: false }).limit(100);

            if (tab === "incoming") {
                q = q.is("assignee_email", null).eq("status", "Yeni");
            } else if (tab === "assigned") {
                q = q.eq("assignee_email", myEmail).in("status", ["İnceleme", "Atandı", "Çalışılıyor", "Beklemede"]);
            } else if (tab === "sla") {
                const t24 = new Date(now.getTime() + 24 * 60 * 60 * 1000).toISOString();
                q = q.eq("assignee_email", myEmail).lt("sla_deadline_at", t24).not("status", "in", ["Tamamlandı", "Reddedildi"]);
            } else if (tab === "approvals") {
                // onaylar approvals tablosundan
                const { data: approvals, error } = await supabase
                    .from("approvals")
                    .select("request_id, decision")
                    .eq("approver_email", myEmail)
                    .eq("decision", "pending")
                    .limit(200);
                if (error) throw error;
                const ids = approvals?.map(a => a.request_id) || [];
                if (ids.length === 0) { setRows([]); setLoading(false); return; }
                const { data: reqs, error: e2 } = await supabase
                    .from("requests").select(`
            id, title, status, priority, requester_email, assignee_email,
            updated_at, due_at, sla_deadline_at
          `).in("id", ids).order("updated_at", { ascending: false });
                if (e2) throw e2;
                setRows(reqs || []); setLoading(false); return;
            }

            const { data, error } = await q;
            if (error) throw error;
            setRows(data || []);
        } catch (e) {
            console.error(e);
            setErr("Kayıtlar çekilemedi.");
        } finally {
            setLoading(false);
        }
    }

    // --- quick actions ---
    async function takeOwnership(id) {
        if (!myEmail) return;
        const { error } = await supabase.from("requests").update({
            assignee_email: myEmail, status: "İnceleme", updated_at: new Date().toISOString()
        }).eq("id", id);
        if (!error) fetchData();
    }

    async function markDone(id) {
        const { error } = await supabase.from("requests").update({
            status: "Tamamlandı", updated_at: new Date().toISOString()
        }).eq("id", id);
        if (!error) fetchData();
    }

    async function rejectReq(id) {
        const { error } = await supabase.from("requests").update({
            status: "Reddedildi", updated_at: new Date().toISOString()
        }).eq("id", id);
        if (!error) fetchData();
    }

    // --- ÇIKIŞ / NAV ---
    function handleLogout() {
        localStorage.removeItem("auth_token");
        localStorage.removeItem("user_profile");
        navigate("/login", { replace: true });
    }

    function goNewRequest() {
        navigate("/newrequest");
    }

    return (
        <div className="inbox">
            <header className="inbox-top">
                <div className="top-left">
                    <h1>Gelen Kutusu</h1>
                </div>

                {/* Sekmeler */}
                <div className="tabs">
                    {TABS.map(t => (
                        <button key={t.key}
                            className={`tab ${tab === t.key ? "active" : ""}`}
                            onClick={() => setTab(t.key)}
                        >
                            {t.label}
                        </button>
                    ))}
                </div>

                {/* Sağ üst araçlar: Yeni Talep + Kullanıcı + Çıkış */}
                <div className="toolbar">
                    <button className="btn ghost" onClick={goNewRequest}>+ Yeni Talep</button>
                    <span className="user-chip">{me?.kullanici || me?.email || "Kullanıcı"}</span>
                    <button className="btn danger" onClick={handleLogout}>Çıkış</button>
                </div>

                <div className="filters">
                    <input className="search" placeholder="Talep no / başlık / kişi…" />
                </div>
            </header>

            {err && <div className="alert error">{err}</div>}

            <div className="list">
                {loading && <div className="skeleton">Yükleniyor…</div>}
                {!loading && rows.length === 0 && <div className="empty">Kayıt bulunamadı.</div>}

                {rows.map(r => (
                    <Row key={r.id}
                        row={r}
                        me={myEmail}
                        onTake={() => takeOwnership(r.id)}
                        onDone={() => markDone(r.id)}
                        onReject={() => rejectReq(r.id)}
                    />
                ))}
            </div>
        </div>
    );
}

function Row({ row, me, onTake, onDone, onReject }) {
    const priorityColor = { P1: "p1", P2: "p2", P3: "p3" }[row.priority] || "p3";
    const isMine = row.assignee_email && row.assignee_email === me;

    return (
        <div className="item">
            <div className="meta">
                <span className={`prio ${priorityColor}`}>{row.priority || "P3"}</span>
                <span className={`status s-${(row.status || "Yeni").toLowerCase()}`}>{row.status || "Yeni"}</span>
            </div>

            <div className="content">
                <div className="title">#{row.id} — {row.title}</div>
                <div className="sub">
                    <span>İsteyen: {row.requester_email}</span>
                    <span> · </span>
                    <span>Atanan: {row.assignee_email || "—"}</span>
                    <span> · </span>
                    <span>Güncellendi: {new Date(row.updated_at).toLocaleString()}</span>
                </div>
            </div>

            <div className="actions">
                {!row.assignee_email && <button className="btn ghost" onClick={onTake}>Üstlen</button>}
                {isMine && (
                    <>
                        <button className="btn primary" onClick={onDone}>Tamamla</button>
                        <button className="btn danger" onClick={onReject}>Reddet</button>
                    </>
                )}
                <button className="btn ghost">Yorum</button>
                <button className="btn ghost">Detay</button>
            </div>
        </div>
    );
}
